/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-duration-picker-root"><ui5-input    value="${ifDefined(context.value)}"    ?disabled="${context.disabled}"    ?readonly="${context.readonly}"    value-state="${ifDefined(context.valueState)}"    @ui5-change="${ifDefined(context._handleInputChange)}"    @ui5-input="${ifDefined(context._handleInputLiveChange)}"    @keydown="${context._onkeydown}"    >        ${ !context.readonly ? block1(context) : undefined }</ui5-input></div>`; };
const block1 = (context) => { return html`<ui5-icon                slot="icon"                name="fob-watch"                tabindex="-1"                show-tooltip                @click="${context.togglePicker}"                input-icon                ?pressed="${context._isPickerOpen}"                class="ui5-duration-picker-input-icon-button"            ></ui5-icon>        `; };

export default block0;
